      "description": "Midjourney: AI to generate images from text\n\nMidjourney is an artificial intelligence that uses natural language processing and image generation algorithms to create quality illustrations. So this new technology generates images from text descriptions (called a prompt). This makes it an ideal tool for artistic projects. Obviously, creators of marketing campaigns or image enthusiasts will be the first to be interested.\n\nDiscover what Midjourney is\n\nOne of the many advantages of Midjourney is that it allows you to create images in a fast, free and efficient way. Its use is done without needing any knowledge of design or complex software (Photoshop for example). You become a “real” artist! Indeed, you just have to provide a description of the desired image, and Midjourney takes care of the rest. No doubt that this AI will be particularly useful if you are out of inspiration.\n\nNote well that, as with any artificial intelligence, there are limits to what this AI can do. First, the quality of the images generated will depend on the accuracy and clarity of your textual description. However, Midjourney continues to improve through continuous learning.\n\nHow to use Midjourney on Discord?\n\nBefore you can play with this image generator, you must create an account and join the Discord server. If you can’t find the Discord server, it is on the Midjourney homepage, click on the button: “Join the Beta”. Once this task is done (not very practical I must admit), enter the command /imagine to generate images. For example, if you want a cosmonaut cat in a realistic style in 4K, you can type /imagine 4K realist cosmonaut cat. Like other competitors, English is required on this site.\n\nBy following these steps, you will be able to maximize your creations in Midjourney for sure. As a result, you will enjoy all the possibilities offered by this artificial intelligence. The results are usually quite incredible and should suit your future artistic or advertising projects.\n\nDo you want more detailed images? With a particular style? Then specify more relevant words for even more precise illustrations.\n\nSome tips for making a high-performance prompt:\nBe specific in your description: the more specific you are in your description, the closer the generated image will be to what you want. Also use precise words to describe the image you want, such as colors, shapes, textures, etc.\nRelevant search terms: build your prompt so that it looks like a Google search. This way you will get the best results.\nBe clear in your request: use simple and clear sentences to describe the image you want. Avoid choosing terms that are too technical or difficult to understand.\nThe style of the image: indicate the style of the image you want, for example realistic, cartoon, etc..\nSpecify the dimensions of the image: specify the desired dimensions for the image, this will allow Midjourney to generate an image directly at the right size.\nUse examples: There are sites like Lexica.art or PromptMania to give you some ideas. Feel free to include them in your prompt and see if the result suits you. Your imagination will do the rest!\nConclusion and review\n\nIn conclusion, Midjourney is certainly the most successful AI for creating images by text. The use of Midjourney is, to date, “free”. In fact, you receive 25 credits as a gift as soon as you register. Thereafter, you will have to use this credit system to continue generating additional images. Midjourney.com is becoming more and more popular at the moment and in our opinion its potential is huge for the future.\n\nThe complete list of all Midjourney commands:\nBasic Midjourney commands\nCommand\tDescription\n/imagine\tFor example, /imagine an apple pie\n/help\tTo get help\n/subscribe\tTo subscribe to the BOT\n/info\tGeneral information\n/fast\tAccelerate generation\n/relax\tYour images generate more slowly\n/public\tGenerate your images in public\n/show < jobid >\tTo review any image\n/private\tGenerate your images privately\nSettings “/imagine”\n\nYou can add parameters after “/imagine” to specify resolution, size, speed, prohibitions, etc.. For example: “/imagine apple pie -iw -q2 0.50\n\nOption\tDescription\n-h\tThe height of the image\n-iw\tThe weight of the image\n-w\tThe width of the image\n-aspect/-ar\tAspect/ ratio of the image\n-fast\tFaster images\n-hd\tHigher resolutions\n-no\tFor example, -no cats\n-seed\tDefines the seed\n-stop\tStops the creation of the image\n-stylize\tStrength of the image style\n-sameseed\tMake a general change\n-q\tModify quality\n-chaos\tThe random mode\n-uplight\tIlluminate\n-beta\tExperimental\n-video\tSave in video format the progress\n-v or -version <1, 2, 3 or 4>\tThe different versions of the algorithms\t\t\nStyling commands\nVersion 3\tStylization\n-s 60000\tStylization at maximum\n-s 20000\tStylisation takes over\n-s 2500\tDefault value\n-s 1250\tLess strict but prettier\n-s 625\tLess artistic\nVersion 4\tStylization\n-s 1000\tMaximum stylization\n-s 500\tDefault value\n-s 250\tLess strict but prettier\n-s or stylize 0\tLess artistic\nQuality controls\nCommand\tDescription\n-q 0.25\t4x faster, much less beautiful\n-q 0.5\t2x faster, less beautiful\n-q 1\tDefault value\n-q2\t2x slower, good results\n-q5\tExperimental\nPréférences\nCommand\tDescription\n/settings\tParamètres visuels\n/prefer suffix\tParamètres suffix\n\n/prefer suffix < text >\n\t\n/prefer auto_dm True\tLes travaux automatiquement DMed\n\n/prefer option set < name > \n\tCrée un raccourci rapide\n/prefer option list\tAffiche la liste de vos options\nText weight\n\nYou can give more weight to certain parts of your prompt. The default value is 1.\n\n/imagine mountain::1.5 landscape::-1\n/imagine cat::1.25 animal::-0.75\n/imagine mountain landscape::-1 animal\nAdd from a URL\n\nYou can also submit a URL for the AI to build on.\n\nThe URL command :\n\n/imagine <URL>\n\nHere is a concrete example:\n\n/imagine https://fr.wikipedia.org/wiki/Lune#/media/Fichier:FullMoon2010.jpg lune\n\n VISIT MIDJOURNEY V6 WEBSITE\nMore sites like  \nMidJourney V6\n  in the category:  \n#IMAGE GENERATORS\n\nTEXT WRITTEN BY A\nHUMAN",
